import React from "react";

const Intro = () =>{
    return(
        <div className="Intro">
            <div className="i-left"></div>
            <div className="i-name">
                <span>Hy! I Am</span>
                <span>Sanket Arote</span>
                <span>Just for Trial purpose</span>
            </div>
            <div className="div-ibutton">
                Hire Me 
            </div>
            <div className="i-right"></div>
        </div>
    )
}

// export default Intro;
